.preloader {
  position: absolute;
  top: 0;
  bottom: 0;
  left: 0;
  right: 0;
  display: flex;
  justify-content: flex-start;
  align-items: center;
  background: #fff;
  z-index: 9999;
  @include padding-for-mobile;
  @include tablet-md {
    justify-content: center;
  }
  &-counter {
    text-align: end;
    font-family: Gilroy;
    font-style: normal;
    font-weight: bold;
    font-size: 50px;
    line-height: 60px;

    /* Primary */

    color: #176abd;
    @include tablet-md {
      font-size: calc(12px + 8vw);
      line-height: 1.2;
    }
  }
  &-container {
    max-width: 604px;
    margin-left: 100px;
    letter-spacing: 0.2px;
    @include tablet-md {
      margin-left: 0;
      max-width: fit-content;
    }
  }
  &-text {
    font-family: Gilroy;
    font-style: normal;
    font-weight: 900;
    font-size: 65px;
    line-height: 81px;
    color: #2a2b31;
    @include tablet-md {
      font-size: calc(12px + 8vw);
      line-height: 60px;
      line-height: 1.2;
    }
  }
}

.cookie {
  position: fixed;
  bottom: 0;
  left: 0;
  right: 0;
  background: azure;
  z-index: 20;
  background: rgba(0, 0, 0, 0.5);
  padding-left: 82px;
  padding-right: 79px;
  min-height: 39px;
  color: #fff;
  display: none;
  &__wrapper {
    display: flex;
    flex-wrap: wrap;
    justify-content: space-between;
    align-items: center;    
    min-height: inherit;
  }
  &__btn {
    color: #176abd;
    font-weight: 700;
  }
}
